def normList2(L, normalizeTo=100):
    '''normalize values of a list to make its max = normalizeTo'''
    vMax = max(L)
    vMin = min(L)
    return [ (x*1.0-vMin)/(vMax*1.0-vMin)*normalizeTo for x in L]
